import React, {useState, useEffect} from 'react'
import {useNavigate} from 'react-router-dom'
import axios from 'axios'

export default function AreaAdm () {
    const navigate = useNavigate()

    const voltar = () => {
        navigate(-1)
    }

    const addViagem = () => {
        navigate("/criar")
    }

    const viagemEscolhida = () => {
        navigate("/cadastrados")
    }

    useEffect(() => {
        const token = localStorage.getItem('token')
        axios.get('https://us-central1-labenu-apis.cloudfunctions.net/labeX/lais/trip/:id', {
            headers: {
                auth: token
            }
        })
        .then((res) => {
            console.log(res.data)
        })
        .catch((error) => {
            console.log('Erro', error.res)
        })
    }, [])

    

    return (
        <>
        <p>Área de Funcionários</p>
            <button onClick= {voltar}> Voltar</button>
            <button onClick = {addViagem}> Adicionar Viagem </button>
            <button onClick = {viagemEscolhida}> Viagem Escolhida </button>
        </>
    )
}
